import React from "react";
import { Row, Col, Button } from "reactstrap";
import south from "../images/southindian.jfif";
import image from "../images/cafee.jpg";
import chole from "../images/chole.jpg";
import biryani from "../images/biryani.jpg";
const Main = (props) => {
  return (
    <div>
      <Row noGutters className="text-center align-items-center">
        <Col className="name">The Taste of India</Col>
      </Row>
      <Row noGutters className="text-center align-items-center">
        <Col>
          <p className="looking-for-pizza text-muted">
            <i>One stop destination for great Indian Food</i>
          </p>
        </Col>
      </Row>
      <div className="container text-center">
        <div className="row" style={{ paddingTop: "10px" }}>
          <div className="col-lg-4">
            <img
              src={south}
              alt="cafe"
              className="big-img"
              style={{
                width: "18em",
                height: "11em",
                borderRadius: "50%",
                opacity: "0.8",
              }}
            />
          </div>
          <div className="col-lg-4">
            <img
              src={biryani}
              alt="cafe"
              className="big-img"
              style={{
                width: "18em",
                height: "11em",
                borderRadius: "50%",
                opacity: "0.8",
              }}
            />
          </div>
          <div className="col-lg-4">
            <img
              src={chole}
              alt="cafe"
              className="big-img"
              style={{
                width: "18em",
                height: "11em",
                borderRadius: "50%",
                opacity: "0.8",
              }}
            />
          </div>
        </div>
      </div>
      <hr style={{ width: "60%", marginTop: "2em" }}></hr>
      <Row>
        <Col className="text-center">
        <span className="looking-for-pizza text-info" style={{fontSize:"2rem"}}>Now you can prebook your seat at the restaurant</span>
        </Col>
      </Row>
      <Row noGutters className="text-center align-items-center py-lg-3">
        <Col>
          <Button
            color="none"
            className="book-table-btn"
            onClick={(_) => {
              props.setPage(1);
            }}
          >
            Book a Table
          </Button>
        </Col>
      </Row>
      <Row noGutters className="text-center big-img-container">
        <Col>
          <img
            src={image}
            alt="cafe"
            className="big-img"
            style={{ background: "transparent", opacity: "0.7" }}
          />
        </Col>
      </Row>
      <div className="container">
        <div className="row">
          <div className="col-lg-6">Review 1</div>
          <div className="col-lg-6">Review 2</div>
        </div>
      </div>
      
    </div>
  );
};

export default Main;
